import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import { Collapse } from 'bootstrap';

function Listings(props) {
  return (
    <>
    <button class="btn btn-outline-dark" type="button" data-bs-toggle="collapse" data-bs-target={`#collapseExample${props.id}`} aria-expanded="false" aria-controls="collapseExample">
    {props.header}
    </button>
    <div class="collapse" id={`collapseExample${props.id}`}>
    <div class="card card-body" id="cardlist">
    <ul>
    {props.langList.map(l => <li class="languages"><p>{l}</p></li>)}
    </ul>
    </div>
    </div>
    </>
  );
}

export default Listings;
